import React, { useEffect, useState } from 'react';

function App(){

    const [backendData, setBackendData] = useState([{}]);

    useEffect(()=>{
        fetch("/api").then(
            response => response.json()
        ).then(
            data => {
                setBackendData(data)
            }
        )
    }, [])

    return (
        <div>

            {(typeof backendData.length === 0) ? (
                <p>Loading</p>
            ): (
                backendData.users.map((user, i)=>(
                    <h2 key={i}>{user}</h2>
                ))
            )}

        </div>
    )
}

export default App;
